function loadcountryselect(id){
    var x = document.getElementById(id);
    for(i=0;i< countrylist.length; i++){
        var option = document.createElement("option");
        option.text = countrylist[i];
        option.value = i;
        x.add(option);
    }
    

}

function loadvarselect(id){
    var x = document.getElementById(id);
    for(i=0;i< factors_name.length; i++){
        var option = document.createElement("option");
        option.text = factors_name[i];
        option.value = i;
        x.add(option);
    } 
}
